function driveFileSrc(file) {
	id = ids[file];
	return 'https://drive.google.com/uc?export=download&id=' + id;

}

function imageSrc(x, y, level) {
    if (!(validTile(x, y, level))) { return driveFileSrc("green.jpg"); }
    file = 'mipmap_' + level + '_' + y + '_' + x + '.jpg';
    return driveFileSrc(file);
}

//gets the src of specific video tile

function videoSrc(x, y, level) {
    if (!(validTile(x, y, level))) { return driveFileSrc("base.mp4"); }
    file = 'mipmap_' + level + '_' + y + '_' + x + '.mp4';
    return driveFileSrc(file);
}